import Vue from 'vue'
import App from './App.vue'
//导入路由模块
import router from '@/router/index'

//导入vant模块
import './vant.js'

//引入socket.io
import { io } from 'socket.io-client'

//引入动画样式
import 'animate.css'

Vue.prototype.socket=io()
Vue.config.productionTip = false

new Vue({
  render: h => h(App),
  router,
}).$mount('#app')
